var logoData = 'data:image/png;base64,';
var loadingData = 'data:image/png;base64,';

var LoaderScene = cc.Scene.extend({
    _interval: null,
    _label: null,
    _className: 'LoaderScene',
    numberSprites: [],

    init: function () {
        var self = this;

        // bg
        var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(216, 216, 216));
        bgLayer.setPosition(cc.visibleRect.bottomLeft);
        self.addChild(bgLayer, 0);


        //loading logo
        cc.loader.loadImg(logoData, function (err, img) {
            if (err) return;
            self._initStage(img, cc.visibleRect.center);
        });
        cc.loader.loadImg(loadingData, function (err, img) {
            if (err) return;
            self._initLoader(img);
        });
        self._initEyes();
        return true;
    },

    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.x = centerPos.x;
        logo.y = centerPos.y + 160;
        self._bgLayer.addChild(logo, 10);
    },
    _initLoader: function (img) {
        var texture = new cc.Texture2D();
        texture.initWithElement(img);
        texture.handleLoadedTexture();

        var loading = new cc.SpriteFrame(texture, cc.rect(2, 66, 101, 30)),
            percent = new cc.SpriteFrame(texture, cc.rect(90, 34, 24, 30));

        var numberArr = [
            cc.rect(99, 2, 19, 30),
            cc.rect(2, 2, 11, 30),
            cc.rect(23, 34, 19, 30),
            cc.rect(15, 2, 19, 30),
            cc.rect(67, 34, 21, 30),
            cc.rect(2, 34, 19, 30),
            cc.rect(36, 2, 19, 30),
            cc.rect(44, 34, 21, 30),
            cc.rect(78, 2, 19, 30),
            cc.rect(57, 2, 19, 30)
        ];

        for (var i = 0; i < numberArr.length; i++) {
            this.numberSprites.push(new cc.SpriteFrame(texture, numberArr[i]));
        }

        var loadSprite = new cc.Sprite(loading);
        loadSprite.x = 310;
        loadSprite.y = 200;
        var percentSprite = new cc.Sprite(percent);
        percentSprite.x = 445;
        percentSprite.y = 200;
        var numberSprite = this.numberSprite = new cc.Sprite();
        numberSprite.x = 400;
        numberSprite.y = 200;
        numberSprite.addChild(new cc.Sprite(this.numberSprites[0]));

        this._bgLayer.addChild(percentSprite);
        this._bgLayer.addChild(loadSprite);
        this._bgLayer.addChild(numberSprite);
    },
    _initEyes: function () {
        var leftDraw = this.leftDraw = new cc.DrawNode(),
            rightDraw = this.rightDraw = new cc.DrawNode();
        leftDraw.x = 300;
        rightDraw.x = 410;
        leftDraw.y = rightDraw.y = 300;

        var bigDot = [cc.p(0, 0), cc.p(-20, 20)],
            leftSmallDot = [cc.p(0, 0), cc.p(20, -20)];

        leftDraw.drawDot(cc.p(0, 0), 45, cc.color(255, 255, 255));
        leftDraw.drawDot(cc.p(-20, 20), 6, cc.color(0, 0, 0));

        rightDraw.drawDot(cc.p(0, 0), 45, cc.color(255, 255, 255));
        rightDraw.drawDot(cc.p(20, -20), 6, cc.color(0, 0, 0));

        this._bgLayer.addChild(leftDraw);
        this._bgLayer.addChild(rightDraw);
    },
    startAnimate: function () {
        var rotateTo = cc.rotateTo(2, 720).repeatForever();
        this.leftDraw.runAction(rotateTo);
        this.rightDraw.runAction(rotateTo.clone());
    },
    /**
     * custom onEnter
     */
    onEnter: function () {
        cc.Node.prototype.onEnter.call(this);
        var loader = (this.loadType == 'resource') ? this._startLoading : this._startAjax;
        this.schedule(loader, 0.3);
        this.startAnimate();
    },
    /**
     * custom onExit
     */
    onExit: function () {
        cc.Node.prototype.onExit.call(this);
        var numberSprite = this.numberSprite;
        numberSprite.removeAllChildren();
        numberSprite.addChild(new cc.Sprite(this.numberSprites[9]));
        var secondSprite = new cc.Sprite(this.numberSprites[9]);
        secondSprite.x = 25;
        numberSprite.addChild(secondSprite);
    },

    /**
     * init with resources
     * @param {Array} resources
     * @param {Function|String} cb
     */
    initWithResources: function (resources, cb) {
        if (cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
        this.loadType = 'resource';
    },
    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        cc.loader.load(res, self._loadProgress.bind(self), function () {
            if (self.cb) self.cb();
        });
    },
    initAjax: function (ajaxSetting) {
        this.ajaxSetting = ajaxSetting;
        this.loadType = 'ajax';
    },
    _startAjax: function () {
        var self = this,
            preNum = 0;
        self.unschedule(self._startAjax);
        if (!this.ajaxSetting.progress) {
            this.ajaxSetting.progress = function (n) {
                n = n.toFixed(2);
                if (preNum === n) return;
                preNum = n;
                self._loadProgress(null, 1, n);
            };
        }
        Utils.ajax(this.ajaxSetting);
    },
    _loadProgress: function (result, count, loadedCount) {
        var percent = (loadedCount / count * 100) | 0;
        percent = Math.min(percent, 100);
        var numberArry = percent.toString().split('');
        this.numberSprite.removeAllChildren();
        if (numberArry.length == 1) {
            this.numberSprite.addChild(new cc.Sprite(this.numberSprites[numberArry[0]]));
        }
        if (numberArry.length == 2) {
            this.numberSprite.x = 385;
            this.numberSprite.addChild(new cc.Sprite(this.numberSprites[numberArry[0]]));
            var secondSprite = new cc.Sprite(this.numberSprites[numberArry[1]]);
            secondSprite.x = 25;
            this.numberSprite.addChild(secondSprite);
        } else {

        }
    }
});

var LoaderLayer = cc.LayerColor.extend({
    count: 0,
    ctor: function () {
        this._super(cc.color(0, 0, 0, 160));
        var draw = new cc.DrawNode();
        draw.x = Config.w_2 - 50;
        draw.y = 260;

        for (var i = 0; i < 3; i++) {
            draw.drawRect(cc.p(40 * i, 0), cc.p(40 * i + 20, 20), cc.color(181, 181, 181), 1, cc.color(181, 181, 181));
        }
        var draw2 = this.draw = new cc.DrawNode();
        draw2.x = Config.w_2 - 50;
        draw2.y = 260;
        draw2.drawRect(cc.p(0, 0), cc.p(20, 20), cc.color(239, 178, 82), 1, cc.color(239, 178, 82));
        this.addChild(draw);
        this.addChild(draw2);
        this.schedule(this.updateLoad, 0.2);
        return true;
    },
    updateLoad: function () {
        var draw = this.draw;
        draw.clear();
        if (this.count > 3) {
            this.count = 0;
        }
        for (var i = 0; i < this.count; i++) {
            draw.drawRect(cc.p(40 * i, 0), cc.p(40 * i + 20, 20), cc.color(239, 178, 82), 1, cc.color(239, 178, 82));
        }
        this.count++;
    },
    onRemove: function () {
        cc.eventManager.resumeTarget(this.parent, true);
        this.removeFromParent(true);
    }
});

LoaderLayer.preload = function (url, data, cb, parent) {
    var loader = cc.LoaderLayer;
    if (!loader) {
        loader = new LoaderLayer();
    }
    cc.eventManager.pauseTarget(parent, true);
    parent.addChild(loader, 3);
   	Utils.ajax({
        url: url,
        type: 'POST',
        data: data,
        success: function (data) {
            loader.onRemove();
            if (cc.isUndefined(data['result'])) {
                cb(data);
            } else {
                if (data['result'] == 0) {
                    cb(data);
                } else {
                    alert(data['list']['msg']);
                }
            }
        },
        error: function (xhr, status, msg) {
            loader.onRemove();
            alert(msg);
        }
   	});
};

LoaderScene.preload = function (resources, cb) {
    var _cc = cc;
    if (!_cc.loaderScene) {
        _cc.loaderScene = new LoaderScene();
        _cc.loaderScene.init();
    }
    _cc.loaderScene.initWithResources(resources, cb);
    cc.director.runScene(_cc.loaderScene);
    return _cc.loaderScene;
};

LoaderScene.ajaxLoad = function (ajaxSetting) {
    var _cc = cc;
    if (!_cc.loaderScene) {
        _cc.loaderScene = new LoaderScene();
        _cc.loaderScene.init();
    }
    _cc.loaderScene.initAjax(ajaxSetting);
    cc.director.runScene(_cc.loaderScene);
    return _cc.loaderScene;
};